import { useTheme } from "../../Context/Theme"

const Button = (props) => {

    const theme = useTheme()

    return (
        <button style={{ backgroundColor: theme.primary, color: theme.secondary }} className='rounded-full py-1 px-3'>
            {props.children}
        </button>
    )
}

export default Button
